import React, { useEffect, useState } from "react";
import ProjectForm from "./ProjectForm";
import ProjectCard from "./ProjectCard";

const API_URL = process.env.REACT_APP_API_URL + "/projects";

export default function ProjectsList() {
  const [projects, setProjects] = useState([]);
  const [search, setSearch] = useState("");
  const [industryFilter, setIndustryFilter] = useState("");
  const [statusFilter, setStatusFilter] = useState("");
  const [skillsFilter, setSkillsFilter] = useState("");
  const [sort, setSort] = useState("");

  const fetchProjects = async () => {
    const res = await fetch(`${API_URL}/?user_id=temp_user`);
    const data = await res.json();
    setProjects(data || []);
  };

  useEffect(() => {
    fetchProjects();
  }, []);

  const addProject = async (formData) => {
    formData.append("user_id", "temp_user");
    const res = await fetch(`${API_URL}/`, { method: "POST", body: formData });
    const newProject = await res.json();
    setProjects((prev) => [...prev, newProject]);
  };

  const deleteProject = async (id) => {
    if (!window.confirm("Delete this project?")) return;
    await fetch(`${API_URL}/${id}/?user_id=temp_user`, { method: "DELETE" });
    setProjects((prev) => prev.filter((p) => p.id !== id));
  };

  // Combined search + filter + sort
  const filteredProjects = projects
    .filter((p) => {
      const text = search.toLowerCase();
      return (
        p.name?.toLowerCase().includes(text) ||
        p.role?.toLowerCase().includes(text) ||
        p.description?.toLowerCase().includes(text) ||
        p.skills_used?.some((s) => s.toLowerCase().includes(text))
      );
    })
    .filter((p) => (industryFilter ? p.industry_type === industryFilter : true))
    .filter((p) => (statusFilter ? p.status === statusFilter : true))
    .filter((p) => (skillsFilter ? p.skills_used.includes(skillsFilter) : true))
    .sort((a, b) => {
      if (sort === "date_desc") return new Date(b.start_date) - new Date(a.start_date);
      if (sort === "date_asc") return new Date(a.start_date) - new Date(b.start_date);
      return 0;
    });

  return (
    <div>
      <h2>Special Projects</h2>
      <ProjectForm addProject={addProject} />

      <div style={{ display: "flex", gap: "10px", margin: "12px 0", flexWrap: "wrap" }}>
        <input
          placeholder="Search projects..."
          value={search}
          onChange={(e) => setSearch(e.target.value)}
        />

        <select value={industryFilter} onChange={(e) => setIndustryFilter(e.target.value)}>
          <option value="">All Industries</option>
          {[...new Set(projects.map((p) => p.industry_type))].map((ind) => (
            <option key={ind} value={ind}>{ind}</option>
          ))}
        </select>

        <select value={statusFilter} onChange={(e) => setStatusFilter(e.target.value)}>
          <option value="">All Status</option>
          <option value="Planned">Planned</option>
          <option value="Ongoing">Ongoing</option>
          <option value="Completed">Completed</option>
        </select>

        <select value={skillsFilter} onChange={(e) => setSkillsFilter(e.target.value)}>
          <option value="">All Skills</option>
          {[...new Set(projects.flatMap((p) => p.skills_used))].map((skill) => (
            <option key={skill} value={skill}>{skill}</option>
          ))}
        </select>

        <select value={sort} onChange={(e) => setSort(e.target.value)}>
          <option value="">Sort…</option>
          <option value="date_desc">Newest</option>
          <option value="date_asc">Oldest</option>
        </select>

        <button onClick={() => window.print()}>🖨 Print</button>
      </div>

      <div className="project-grid">
        {filteredProjects.map((p) => (
          <ProjectCard key={p.id} project={p} deleteProject={deleteProject} />
        ))}
      </div>
    </div>
  );
}
